d4\u30a2\u30ce\u3092\u7fd2\u3044\u59cb\u3081\u308b\u3002\u30af\u30e9\u30b7\u30c3\u30af\u97f3\u697d\u3084CM\u30bd\u30f3\u30b0\u306a\u3069\u30c6\u30ec\u30d3\u304b\u3089\u6d41\u308c\u308b\u97f3\u697d\u3092\u8074\u3044\u3066\u80b2\u3063\u305f\u3002\u82b8\u540d\u306e\u7531\u6765\u3068\u306a\u3063\u305f\u5b50\u4f9b\u6642\u4ee3\u306e\u3042\u3060\u540d\u300c\u30a8\u30dd\u300d\u306f\u3001\u4eba\u304c\u300c\u3048\u30fc\u3053\u3061\u3083\u3093\u300d\u3068\u547c\u307c\u3046\u3068\u3057\u305f\u3068\u304d\u306b\u3001\u820c\u304c\u3082\u3064\u308c\u3066\u300c\u3048\u30fc\u307d\u3061\u3083\u3093\u300d\u3068\u547c\u3093\u3060\u3053\u3068\u304c\u304d\u3063\u304b\u3051\u3067\u300c\u30a8\u30dd\u300d\u3068\u547c\u3070\u308c\u308b\u3088\u3046\u306b\u306a\u3063\u305f\u3068\u3044\u3046\u30021976\u5e743\u6708\u3001\u4e16\u7530\u8c37\u533a\u7acb\u65b0\u661f\u4e2d\u5b66\u6821\u5352\u696d\u3002\u540c\u5e744\u6708\u3001\u6771\u4eac\u90fd\u7acb\u677e\u539f\u9ad8\u7b49\u5b66\u6821\u306b\u5165\u5b66\u3002\u97f3\u697d\u95a2\u4fc2\u8005\u3067\u306f\u3001\u9ad8\u6821\u306e\u5148\u8f29\u306b\u6e05\u6c34\u4fe1\u4e4b\u3001\u5f8c\u8f29\u306b\u4f50\u6a4b\u4f73\u5e78\u304c\u3044\u308b\uff08\u6e21\u8fba\u7f8e\u91cc\u3082\u540c\u6821\u51fa\u8eab\uff09\u3002\u540c\u9ad8\u6821\u5728\u5b66\u4e2d\u3001\u300cLaugh\u300d\u3068\u3044\u3046\u30d0\u30f3\u30c9\u3092\u7d44\u3093\u3067\u30d4\u30a2\u30ce\u3068\u30b3\u30fc\u30e9\u30b9\u3092\u62c5\u5f53\u3002\u300cLaugh\u300d\u306f\u30cb\u30c3\u30dd\u30f3\u653e\u9001\u306e\u30b3\u30f3\u30c6\u30b9\u30c8\u756a\u7d44\u300e\u30e9\u30a4\u30aa\u30f3\u30fb\u30d5\u30a9\u30fc\u30af\u30fb\u30d3\u30ec\u30c3\u30b8\u300f\u306b\u51fa\u5834\u3057\u3066\u512a\u52dd\u3057\u3001\u3053\u308c\u3092\u5951\u6a5f\u306b\u591a\u304f\u306e\u97f3\u697d\u696d\u754c\u95a2\u4fc2\u8005\u306b\u4f1a\u3063\u305f\u3053\u3068\u3067\u3001\u81ea\u8eab\u3082\u97f3\u697d\u306e\u4ed5\u4e8b\u3092\u3057\u305f\u3044\u3068\u601d\u3046\u3088\u3046\u306b\u306a\u308b\u3002\u6d0b\u697d\u306e\u30ab\u30fc\u30da\u30f3\u30bf